import React from "react";
import { Routes, Route } from "react-router-dom";

import IndexPage from "./pages/Index.js";
import OccupationsPage from "./pages/Occupations.js";
import IndustriesPage from "./pages/Industries.js";
import ThemePage from "./pages/Themes.js";
import EventPage from "./pages/Event.js";
import EventCreate from "./pages/EventCreate.js";
import IndustriesCreate from "./pages/IndustriesCreate.js";
import OccupationCreate from "./pages/OccupationsCreate.js";
import ThemesCreate from "./pages/ThemesCreate.js";

function App() {
  return (
    <Routes>
      <Route path="/" element={<IndexPage />} />

      <Route path="/occupations/*" element={<OccupationsPage />}>
        <Route path="new" element={<OccupationCreate />} />
      </Route>

      <Route path="/industries/*" element={<IndustriesPage />}>
        <Route path="new" element={<IndustriesCreate />} />
      </Route>

      <Route path="/themes/*" element={<ThemePage />}>
        <Route path="new" element={<ThemesCreate />} />
      </Route>

      <Route path="/event/*" element={<EventPage />}>
        <Route path="new" element={<EventCreate />} />
      </Route>
    </Routes>
  );
}

export default App;
